package com.dingapp.biz.db.orm;public class ShopListBean {	private int merchant_id;	private String merchant_address;	private String merchant_mobile;	private ImageBigAndMinBean merchant_pic;	private String merchant_nick;	public int getMerchant_id() {		return merchant_id;	}	public void setMerchant_id(int merchant_id) {		this.merchant_id = merchant_id;	}	public String getMerchant_address() {		return merchant_address;	}	public void setMerchant_address(String merchant_address) {		this.merchant_address = merchant_address;	}	public String getMerchant_mobile() {		return merchant_mobile;	}	public void setMerchant_mobile(String merchant_mobile) {		this.merchant_mobile = merchant_mobile;	}	public ImageBigAndMinBean getMerchant_pic() {		return merchant_pic;	}	public void setMerchant_pic(ImageBigAndMinBean merchant_pic) {		this.merchant_pic = merchant_pic;	}	public String getMerchant_nick() {		return merchant_nick;	}	public void setMerchant_nick(String merchant_nick) {		this.merchant_nick = merchant_nick;	}	}